        textalign:"center",
        color:"white",

    }
  return (
     <>
        <div style={footerStyle}>
            <div><p><center>Copyright &copy; CSE | RGUKT-Basar. All Rights Reserved. Contact Us: +91 80081 55105</center></p></div>
        </div>

    </>
  )
}
